import React, { Component } from 'react';
import { Card } from 'antd';

const { Meta } = Card;

function CardSaya(props) {
    return (
        <div>
            <p>Nama : {props.nama}</p>
            <p>Nim : {props.nim}</p>
        </div>
    )
}

export default class Cards extends Component {
    render() {
        return (
            <div className="wrapper">
                <div>
                    <CardSaya
                        hoverable
                        style={{ width: 240 }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        nama="Muhammad Fadhli Hisyam" nim="21120117130078"
                    </CardSaya>
                </div>
                <div>
                    <CardSaya
                        hoverable
                        style={{ width: 240 }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta nama="Naufal Muhammad Shafa" nim="21120117120031" />
                    </CardSaya>
                </div>
            </div>

        );
    }
}
